import './App.css';
import { CardItem } from './components/CardItem/CardItem';
import { Cards } from './components/CardItem/Cards';
import { Catalogs } from './components/Catalogs/Catalogs';
import { Footer } from './components/Footer/Footer';
import { Header } from './components/Header/Header';
import { ModelItem } from './components/ModelItem/ModelItem';
import { Offers } from './components/Offers/Offers';
import { state } from './data';


function App() {

  return (
    <div className="App">
      <div className='header'>
        <Header/>
      </div>
      <div className='content'>
        <Offers product={state.product} type="sale" title='Flash Sales'/>
        <Offers product={state.product} type="new" title='Нові моделі'/>
        <Offers product={state.product} type="popular" title='Популярні моделі'/>
        <Cards />
      </div>
      <div className='footer'>
        <Footer /> 
      </div>
    </div>
  );
}

export default App;
